%[text] ## 2.1. Equations of motion
%[text] The following steps are a guideline for developing the template Simulink model provided into a high-fidelity N-rotor vehicle simulation that will allow you to assess the empirical-stability and performance of a controller without damaging your real-world vehicle.
%[text] Before working in Simulink, explain why there are seemingly 15 equations of motion despite the full state vector being defined as a 12-dimensional.
%[text] ```
%[text] Write your answer here...
%[text] ```
%%
%[text] ### 2.1.1 Implementation of the Equations of Motion using a MATLAB function block
%[text] Now add the non-linear, continuous-time, equations of motion to the template N-rotor vehicle Simulink model provided. Use the \\all-in-one-block" approach described in Section 3.1.3 of the course script to implement the EoM in the MATLAB function block of the template. Remeber that all the variables needed to complete this task are specfied and described in [exercise01 get vehicle parameters.m](file:exercise01_get_vehicle_paramters.m).
%[text] To open the Simulink model and open the MATLAB function block with the template, run this code section below:
load_system('exercise01_simulation_model_template_R2025b')              
open_system('exercise01_simulation_model_template_R2025b/N-rotor_vehicle_model/EoM_one_shot','tab')
%[text] Further guidance on how to implement the equations is given in the template. For convenience, the full state definition and equations of motion are referred below.
%[text] ![](text:image:142d)
%%
%[text] ### 2.1.2 Validation of EoM Implementation
%[text] Confirm the equations have been correctly added to the Simulink model by observing the reference tracking performance.
%[text] The code below will open your modified template model and display the behavior of the quad-copter with respect to a step response.
%run a simulation of the implementation...
sim('exercise01_simulation_model_template_R2025b')
sim_out = get_sim_data(logsout);
plot_sim_data(sim_out)
